			},
			field: 'id_level'
		},
		img: {
			type: DataTypes.STRING(120),
			notEmpty: true,
			field: 'img'
		},
		createdAt: {
			type: DataTypes.DATE,
			allowNull: true,
			field: 'createdAt'
		},
		updatedAt: {
			type: DataTypes.DATE,
			allowNull: true,
			field: 'updatedAt'
		}
	}, {
		tableName: 'def_user'
	});

	authUsers.associate = function (models) {
		authUsers.hasMany(models.busMsgs, {
			foreignKey: 'id_user',
			as: 'busMsgs'
		});
	}
	authUsers.associate = function (models) {
		authUsers.belongsTo(models.authDeps, {
			foreignKey: 'id_dep',
			as: 'authDeps'
		});
	}	
	return authUsers;
};

